class Solution:
    def leftmostBuildingQueries(self, heights, queries):
        n = len(heights)
        m = len(queries)
        for i in range(m):
            queries[i].append(i)
        heights = [[h, i] for i, h in enumerate(heights)]
        heights.sort()
        queries.sort(key=lambda x: x[2])
        ans = [-1] * m
        tree1 = {}
        tree2 = {}
        for i, (h, j) in enumerate(heights):
            tree1[h] = i
            tree2[h] = j
        for i, (l, r, idx) in enumerate(queries):
            while True:
                if l in tree1 and tree1[l] <= tree2[r]:
                    if any(tree2[h] > r for h in range(l + 1, r + 1) if h in tree1):
                        ans[idx] = r
                        break
                    else:
                        l = r
                        r = tree2[r]
                else:
                    break
            if ans[idx] != -1:
                break
        return ans
